	proc playBlindingLights
	;----------------------------------------
	;plays the song blinding lights
	;----------------------------------------
	push cx
	push bx
	push ax
	push dx
	mov cl, 0
	mov ch, 0
	
BLpt1:
	cmp cl, 2
	je jmpPt2
	
	mov [sec], 1 ; 1 x 0.055sec = ~0.055sec
	call delay
	
	mov [note], 3417 ;F4
	mov [sec], 5 ; 5 x 0.055sec = ~0.275sec
	call playNote
	
