	call delay
	
	mov [note], 3417 ;F4
	mov [sec], 6 ; 6 x 0.055sec = ~0.275sec
	call playNote
	
	mov [sec], 1 ; 1 x 0.055sec = ~0.055sec
	call delay
	jmp BLpt1Continue
	
 jmpPt2: 
	jmp BLpt2
	
BLpt1Continue:
	mov [note], 3835 ;Dm4
	mov [sec], 4 ; 4 x 0.055sec = ~0.22sec
	call playNote
	
	mov [note], 3417 ;F4
	mov [sec], 4 ; 4 x 0.055sec = ~0.22sec
	call playNote
	
	mov [note], 3044 ;G4
	mov [sec], 4 ; 4 x 0.055sec = ~0.22sec
	call playNote
	
	mov [sec], 1 ; 1 x 0.055sec = ~0.055sec
	call delay
	
	mov [note], 4560 ;C4
	mov [sec], 5 ; 5 x 0.055sec = ~0.275sec
	call playNote
	
	mov [sec], 1 ; 1 x 0.055sec = ~0.055sec
	call delay
	
	mov [note], 3835 ;Dm4
	mov [sec], 5 ; 5 x 0.055sec = ~0.275sec
	call playNote
	
	inc cl
	mov [sec], 1; 1 x 0.055sec = ~0.055sec
	call delay
	jmp BLpt1
	
BLpt2:
	cmp ch, 2
	je BLend
	
	mov [sec], 1 ; 1 x 0.055sec = ~0.055sec
	call delay

	mov [note], 2559 ;Am4
	mov [sec], 4 ; 4 x 0.055sec = ~0.22sec
	call playNote
	
	mov [note], 3044 ;G4
	mov [sec], 4 ; 4 x 0.055sec = ~0.22sec
	call playNote
	
	mov [note], 3417 ;F4
	mov [sec], 4 ; 4 x 0.055sec = ~0.22sec
	call playNote
	
	mov [sec], 2 ; 2 x 0.055sec = ~0.11sec
	call delay
	
	mov [note], 3835 ;Dm4
	mov [sec], 5 ; 5 x 0.055sec = ~0.275sec
	call playNote
	
	inc ch
	jmp BLpt2
	
BLend:
	
	mov [sec], 1 ; 1 x 0.055sec = ~0.055sec
	call delay
	
	mov [note], 3417 ;F4
	mov [sec], 4 ; 4 x 0.055sec = ~0.22sec
	call playNote
	
